De acordo com a notícia publicada na página da internet do The Budapest Times, as fortes chuvas fizeram subir o nível da água do rio Danúbio e provocaram o transbordamento do rio na capital.
Num comunicado da Direção-Geral da Administração Húngara da Água, foi referido que o nível da água do rio Danúbio atingiu 693 centímetros em Budapeste.
O comunicado refere ainda que o nível da água na cidade de Mohaç, no sul da Hungria, deverá atingir 805 centímetros a 31 de dezembro.
Em 2013, na Hungria, o rio Danúbio registou um nível de água de 891 centímetros devido às inundações causadas pelas fortes chuvas nesse ano.
